import React from 'react'

function ProjectCard({details}) {
    return (
        <div className="project-card">
            <h6>{details.title}</h6>

            <div className="project-duration">{details.images}</div>

            <ul>
                {details.resposibilities.map((item) => (
                    <li key={item}>{item}</li>
                ))}
            </ul>
        </div>
    )
}

export default ProjectCard
